import styled from "styled-components";

const TodoBox = styled.div`
  // 그리고 이 안에 스타일 코드를 작성합니다. 스타일 코드는 우리가 알고 있는 css와 동일합니다.
  max-width: 1150px;
  background-color: white;
  margin: auto;
  border: 1px solid black;
  border-radius: 10px;
`;

function Todo() {
  return (
    <div>
      <TodoBox>
        Todo<button>완료</button>
        <button>삭제</button>
      </TodoBox>
    </div>
  );
}

export default Todo;
